INSERT INTO `toa_dskinfo` VALUES ('2', '赵向来', '58', '1', '河南省大众创业导师，海南省创业导师，用友摩策河南网络科技（集团）有限公司总经理 ，郑州大学信息专家委员会专家、兼职教授 ，河南省工信委信息化行业专家，中国智慧品牌发展研究院副理事长，河南IT服务商联盟副理事长，河南财政金融学院客座教授，亚太最大互联网管理软件厂商--用友集团信息化咨询专家 ，长江三角洲城市经济协调会特聘专家，郑州郑东新区创业孵化基地等管理顾问', '管理咨询,互联网技术', 'dskmana/dsimages/zxl.png', '2018-08-15 14:49:45', '2');
INSERT INTO `toa_dskinfo` VALUES ('3', '张冲', '151', '1', '河南省大众创业导师，人社部（SIYB）项目国家培训师，人社部网络创业项目成员，农业部农业创业项目培训师，浙江省大学生创业联盟导师，大学生创业教育（KAB）培训师， 擅长领域：创业培训；网创指导，大学生、政府及公务员各类讲座，农民工创业指导，创业大赛指导咨询；政府、企业互联网+方面培训指导； 创业孵化器运营及审核。', '教育培训,管理咨询', 'dskmana/dsimages/zc.png', '2018-09-07 21:55:06', '4');
INSERT INTO `toa_dskinfo` VALUES ('4', '张征兵', '150', '1', '河南省大众创业导师，郑州市大众创业导师，清华大学DMC创业导师，现任：财苑豪德融资租赁有限公司董事长，北京重阳控股CEO，赛伯乐基金合伙人。清华紫荆MBA，美国索菲亚访问学者，工程师。业务特长及关注领域：企业投融资管理、基金管理、企业战略、市场营销等。关注行业：智能及先进制造业、基于互联网创新创业项目、企业重组并购等。', '管理咨询,投融资咨询', 'dskmana/dsimages/zzb.png', '2018-09-07 21:55:16', '3');
INSERT INTO `toa_dskinfo` VALUES ('6', '邓宝山', '159', '1', '河南省大众创业导师，人社部劳动科学研究所研究员，联合国国际劳工组织创业与企业战略培训咨询知名专家，中国全国创业培训工作指导委员会特邀顾问，中国SIYB创业培训项目创始人，SIYB国际高级培训师，为中国SIYB创业培训项目的教材引进、改编、开发、项目推广、项目监督评估体系的建立以及培训师资队伍的建设做出了重要的技术支持与贡献。为全国和全球开发SIYB培训师近200名，这些培训师为超万人的SIYB师资队伍建设奠定了坚实基础。', '政策咨询', 'dskmana/dsimages/dengbaoshan.png', '2018-09-14 11:18:54', '1');
INSERT INTO `toa_dskinfo` VALUES ('8', '孙学敏', '160', '1', '河南省大众创业导师，河南省大众创业导师团政策研究与宣传委员会牵头人，郑州大学商学院教授，西方经济学博士，硕士生导师，郑州大学商学院西方经济学学科带头人，郑州大学MBA教育中心中小企业管理专业方向负责人；担任河南省科技型中小企业发展公共服务平台——郑州大学企业研究中心主任，河南省人文社科重点研究基地——郑州大学现代产业与企业发展战略研究中心主任，中美合作郑州大学国际中小企业创新发展中心秘书长。', '政策咨询', 'dskmana/dsimages/sunxuemin.png', '2018-09-14 11:23:38', '5');
INSERT INTO `toa_dskinfo` VALUES ('9', '崔炜', '162', '1', '河南省大众创业导师，河南财经政法大学就业指导处处长，兼任创新创业教育学院院长，副教授，国家高级职业指导师，国家创业二级咨询师，GCDF，河南省大众创业导师，入选教育部大众创业导师库。', '管理咨询,政策咨询', 'dskmana/dsimages/cuiwei.png', '2018-09-14 11:23:57', '6');
