INSERT INTO `toa_job_talent` VALUES ('17', '20171223115758', '6', '张香宁', '女', '18238989135', '16', '74', '', '<p>我的优势是审慎，在决定事情之前会先三四这件事做了之后会出现哪些后果，再诉说给朋友听，如果多数表示支持就会去做这件事，有不同意的会听取他们的意见</p>\r\n<p>包容，知道每个人都有自己的想法，自己的目标与理想，所以在有些决定上产生分歧或做了别人不可理解的决定我大多数会理解包容的，前提是价值观正确</p>\r\n<p>责任，深知不能轻易地许下诺言，因为你的一个随意的答应就会为别人规划已久的事情带来损失</p>\r\n<p>排难就是会从事情失败的原因中总结经验吧！还<span style=\"line-height:1.5;\">有是战略！</span></p>', '85', '2017-12-23 12:00:38');
