INSERT INTO `toa_job_talent` VALUES ('36', '20171223114432', '6', '吴苗苗', '女', '15703892056', '1', '74', '', '<p>&nbsp; &nbsp; &nbsp;我的名字吴苗苗，此次比赛我负责的项目是豫“饰”工作室（豫剧文化与现代服饰的结合）。今天我的测评结果前五项依次分别为: 成就、行动、适应、分析、统筹。</p>\r\n<p>&nbsp; &nbsp; 我是设计学院2016级服装与服饰设计的一名学生，现在班内担任职务为团支书，有丰富的学生管理经验，我大一通过自己的努力，拿到了国家奖学金，综合成绩与专业成绩均为第一，我积极参与各种活动比赛，也组织过各种活动。我被评为校级优秀干部；大一寒假，我下乡组织留守儿童绘画学习，给他们提供绘画材料，被我们学院评为“寒假社会实践活动先进个人”；在大一暑假，去画室兼职任教；2016年12月，在我们学院举办的创意集市中，独自完成制作桌旗两套，全手工缝制，得到了老师的喜爱并购买，并且我还制作了大量的香薰蜡片工艺品，在第一天就有了极高的销量，深得大众喜爱；我也积极参加各种服装大赛；</p>\r\n<p>&nbsp; &nbsp; &nbsp;</p>', '108', '2017-12-23 12:14:29');
