INSERT INTO `toa_job_talent` VALUES ('39', '20171223115506', '6', '王宏远', '男', '15738057669', '13', '74', '', '<p>&nbsp;</p>\r\n<p>优势：包容，分析，搜集，思维，责任</p>\r\n<p>缺点：伯乐，适应，取悦，前瞻，关联</p>\r\n<p>本人来自周口师范学院，现任物电学院团总支学生会副书记，热爱学习积极向上，多次获得校级、院级荣誉，且暑假期间参与学校三下乡活动，前往革命圣地——井冈山进行学习交流，保障团队的完美运营。</p>', '126', '2017-12-23 12:15:15');
INSERT INTO `toa_job_talent` VALUES ('40', '20171223120818', '6', '李俊鸽', '男', '18137723535', '1', '74', 'data/uploadfile/60/20171223/个人简历(1).docx', '<p class=\"MsoNormal\"><b><span style=\"font-family:楷体;font-size:14pt;\">2016年9月导演策划2015级中外合作办学音乐学班级第92场实践周荣获一等奖;</span></b><b><span style=\"font-family:楷体;font-size:14pt;\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-family:楷体;font-size:14pt;\">2017年7月导演策划周口锦弦吉他方克鼓校</span></b><b><span style=\"font-family:楷体;font-size:14pt;\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-family:楷体;font-size:14pt;\"><span style=\"font-family:楷体;\">在周口市体育中心考级活动</span>;</span></b><b><span style=\"font-family:楷体;font-size:14pt;\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-family:楷体;font-size:14pt;\">2017年8月导演策划周口锦弦吉他方克鼓校</span></b><b><span style=\"font-family:楷体;font-size:14pt;\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-family:楷体;font-size:14pt;\"><span style=\"font-family:楷体;\">在周口市人民会堂汇报演出活动</span>;</span></b><b><span style=\"font-family:楷体;font-size:14pt;\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-family:楷体;font-size:14pt;\">2017年10月导演策划2015级中外合作办学音</span></b><b><span style=\"font-family:楷体;font-size:14pt;\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-family:楷体;font-size:14pt;\"><span style=\"font-family:楷体;\">乐学班级第</span>107场艺术实践周;</span></b><b><span style=\"font-family:楷体;font-size:14pt;\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-family:楷体;font-size:14pt;\">2017年11月在河南省大学生“校园好声音”</span></b><b><span style=\"font-family:楷体;font-size:14pt;\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-family:楷体;font-size:14pt;\"><span style=\"font-family:楷体;\">比赛中担任总导演助手</span>;</span></b><b><span style=\"font-family:楷体;font-size:14pt;\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-family:楷体;font-size:14pt;\">2017年12月跟随范明磊副教授完成“河南</span></b><b><span style=\"font-family:楷体;font-size:14pt;\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-family:楷体;font-size:14pt;\"><span style=\"font-family:楷体;\">省人才培养</span>”国家艺术基金项目结项工作</span></b><b><span style=\"font-family:楷体;font-size:14pt;\"><o:p></o:p></span></b></p>', '60', '2017-12-23 12:15:20');
