INSERT INTO `toa_job_talent` VALUES ('42', '20171223120649', '6', '李睿君', '女', '15538610153', '1', '74', '', '我是OS私人定制的项目负责人，我的优势是善于思考，善于观察身边人的特点，性格，具有亲和力。通过测试，我的结果为具有很强的信仰，并且可以体谅别人，站在别人的角度替别人思考问题，剩下的得分最高的三项分别是个别，关联和排难，我相信这些都是作为一个创业者必不可少的品质。排除困难，勇往直前，不能够因为一些小小的问题而退缩，把困难当垫脚石，抓住团队成员的心灵，去爱你的每一个队员，和你的队员一起成长进步，在绝望的心中开出希望的花，不抛弃不放弃，这就是我的初衷和信仰。作为一个团队的负责人，我有能力，有信心，有勇气去用心做事，把每一个人的优势发挥到最大。', '83', '2017-12-23 12:16:06');
