INSERT INTO `toa_job_talent` VALUES ('59', '20171223121723', '6', '王天天', '女', '15138251025', '14', '74', '', '<p>测评结果：五大优势：</p>\r\n<p>审慎：1.750</p>\r\n<p>交往：1.625</p>\r\n<p>战略、体谅：1.600</p>\r\n<p>完美：1.588</p>\r\n<p>个别、责任、排难:1.563</p>\r\n<p>以上为测评结果。</p>\r\n<p>另外，在平时生活中，保持积极向上的生活态度，与人交往和平友好，善于与人交流合作，积极帮助有困难的同学和朋友，善于发现别人的长处和优点，善于激励别人的潜能爆发。平常多做兼职等工作，积累了一定的工作经验，共哟普李玉以后工作的进行。</p>\r\n<p>在学习中，我认真学习专业课程，也积极学习其他技能，丰富自己的素养与知识，为以后的学习和工作奠定基础。</p>\r\n<p>在比赛中，我认真落实每一步，争取做到亲力亲为，制定好计划，认真落实，善于团队合作，倾听别人的意见，有坚持的信念。</p>\r\n<p>总之，我已经准备好了迎接新的挑战，希望领导可以认真考虑我，在以后的工作中，我也会坚定信念，积极认真，让自己的才能得到发挥，为公司奉献自己的力量。</p>', '130', '2017-12-23 12:31:35');
