INSERT INTO `toa_job_talent` VALUES ('65', '20171223141303', '6', '任锐', '男', '13781213383', '1', '74', 'data/uploadfile/128/20171223/任锐简历.docx', '<p>姓名：任锐</p>\r\n<p>优势：行动 分析 信仰 审慎 关联</p>', '128', '2017-12-23 14:16:17');
INSERT INTO `toa_job_talent` VALUES ('66', '20171223121323', '6', '解吉月', '女', '15036278935', '1', '74', '', '<p>我的五项优势是战略，思维，责任，理念，统率</p>\r\n<p>本人曾任学院外联部部长，从学生干部到学生部长，在这个系统中，明白了组织的结构与分工，我也曾多次成功拉取赞助取得优异成果，拥有出色的人际交往和谈判能力，处事严谨且灵活多变，有很强的责任心，做事有始有终</p>', '131', '2017-12-23 14:27:46');
INSERT INTO `toa_job_talent` VALUES ('67', '20171223141306', '6', '连雪杰', '女', '15225779837', '13', '74', '', '<p>排难</p>\r\n<p>交往</p>\r\n<p>行动</p>\r\n<p>责任</p>\r\n<p>专业计算机科学与技术</p>\r\n<p>个人介绍：待人真诚，为人随和，善于沟通。有良好的人际关系。团队协作精神和独立工作能力很强的责任心和工作能力。不惧挑战。</p>\r\n<p>工作内容：</p>\r\n<p>负责开发项目计划书，建立项目设计方案，分配任务。配合工程内部解决项目实际问题。提供专业技术支持</p>', '73', '2017-12-23 14:46:14');
INSERT INTO `toa_job_talent` VALUES ('68', '20171223144807', '6', '成亚新', '女', '15138237905', '13', '74', '', '<p>信仰</p>\r\n<p>行动</p>\r\n<p>包容</p>\r\n<p>沟通</p>\r\n<p>专业计算机科学与技术</p>\r\n<p>个人介绍：待人真诚，为人随和，善于沟通。有良好的人际关系。团队协作精神和独立工作能力很强的责任心和工作能力。不惧挑战。</p>\r\n<p>工作内容：</p>\r\n<p>负责开发项目计划书，建立项目设计方案，分配任务。配合工程内部解决项目实际问题。提供专业技术支持</p>', '74', '2017-12-23 14:53:37');
INSERT INTO `toa_job_talent` VALUES ('69', '20171223145722', '6', '牛志超', '男', '18839755751', '13', '74', '', '<p>沟通</p>\r\n<p>责任</p>\r\n<p>自信</p>\r\n<p>竞争</p>\r\n<p>专业计算机科学与技术</p>\r\n<p>个人介绍：待人真诚，为人随和，善于沟通。有良好的人际关系。团队协作精神和独立工作能力很强的责任心和工作能力。不惧挑战。</p>\r\n<p>工作内容：</p>\r\n<p>负责开发项目计划书，建立项目设计方案，分配任务。配合工程内部解决项目实际问题。提供专业技术支持</p>', '72', '2017-12-23 14:59:26');
INSERT INTO `toa_job_talent` VALUES ('70', '20171223144821', '6', '郭薇', '女', '17335303077', '10', '74', '', '<p>我是教育科学学院心理学专业的大二学生，性别女。</p>\r\n<p><span style=\"line-height:1.5;\">我的后五项缺点是：统筹、竞争、统率、理念、完美。我的缺点是分析人的性格特点能力弱，被动、需要鼓动，工作经验不足。</span></p>\r\n<p><span style=\"line-height:1.5;\">我的前五项优点是：行动、责任、包容、搜集、信仰。我</span><span style=\"line-height:1.5;\">注重积极实干，性格随和，责任感和行动力强，通过分析自己的不足在学习中不断前进。</span></p>\r\n<p><span style=\"line-height:1.5;\">任职班级团支书和心理社团会长，经常在社团活动中辅导老师进行交流、学习，在班级中与同学们关系处理得当。在寒暑假的实践活动中我数次在辅导班教过学，也去小学见习过，乐于助人，踏实严谨。</span></p>', '97', '2017-12-23 15:11:21');
INSERT INTO `toa_job_talent` VALUES ('71', '201403010164', '6', '王恒', '男', '15936089663', '14', '74', '', '<p>战略&nbsp;&nbsp;2.120</p>\r\n<p>审慎&nbsp; 1.980</p>\r\n<p>沟通&nbsp; 1.780</p>\r\n<p>思维&nbsp;&nbsp;1.563</p>\r\n<p>责任&nbsp; </p>', '112', '2017-12-23 15:23:09');
INSERT INTO `toa_job_talent` VALUES ('72', '20171223152305', '6', '赵润含', '女', '18713993759', '13', '74', '', '<p>物电学院学生会主席，积极向上，乐观豁达。</p>\r\n<p style=\"font-family:Simsun, Arial, sans-serif;font-size:13.3333px;\">优势：包容，分析，搜集，思维，责任</p>\r\n<p style=\"font-family:Simsun, Arial, sans-serif;font-size:13.3333px;\">缺点：伯乐，适应，取悦，前瞻，关联</p>', '126', '2017-12-23 15:24:05');
