INSERT INTO `toa_oalog` VALUES ('1414', '58', 'a:9:{s:9:\"dbilldate\";s:10:\"2018-08-10\";s:7:\"modelid\";s:1:\"1\";s:9:\"modelname\";s:24:\"创业商业模式实训\";s:6:\"teamid\";s:1:\"4\";s:8:\"teamname\";s:15:\"教师端账套\";s:4:\"date\";s:19:\"2018-08-10 09:23:27\";s:3:\"uid\";s:2:\"58\";s:4:\"ztid\";s:1:\"4\";s:7:\"comment\";s:102:\"整体商业模式信息较准确，模式比较新颖，整体较好但还有部分内容需要完善\";}', 'jiaoshi于2018-08-10 09:23:27新建打分单据', '2018-08-10 09:23:27', '16', '36');
INSERT INTO `toa_oalog` VALUES ('1415', '58', 'a:9:{s:9:\"dbilldate\";s:10:\"2018-08-10\";s:7:\"modelid\";s:1:\"2\";s:9:\"modelname\";s:27:\"公司治理与股权设计\";s:6:\"teamid\";s:1:\"4\";s:8:\"teamname\";s:15:\"教师端账套\";s:4:\"date\";s:19:\"2018-08-10 09:24:32\";s:3:\"uid\";s:2:\"58\";s:4:\"ztid\";s:1:\"4\";s:7:\"comment\";s:60:\"股权结构设计基本合理，需要在进行合理梳理\";}', 'jiaoshi于2018-08-10 09:24:32新建打分单据', '2018-08-10 09:24:32', '17', '36');
INSERT INTO `toa_oalog` VALUES ('1416', '58', 'a:9:{s:9:\"dbilldate\";s:10:\"2018-08-10\";s:7:\"modelid\";s:1:\"3\";s:9:\"modelname\";s:27:\"团队组建和人才策略\";s:6:\"teamid\";s:1:\"4\";s:8:\"teamname\";s:15:\"教师端账套\";s:4:\"date\";s:19:\"2018-08-10 09:25:50\";s:3:\"uid\";s:2:\"58\";s:4:\"ztid\";s:1:\"4\";s:7:\"comment\";s:288:\"正如核心资源一样,关键业务也是创造和提供价值主张、接触市场、维系客户关系并获取收入的基础。而且关键业务\r\n也会因商业模式的不同而有所区别。例如对于微软等软件行业制造商而言，其关键业务包括软件开发。\";}', 'jiaoshi于2018-08-10 09:25:50新建打分单据', '2018-08-10 09:25:50', '18', '36');
INSERT INTO `toa_oalog` VALUES ('1417', '58', 'a:9:{s:9:\"dbilldate\";s:10:\"2018-08-10\";s:7:\"modelid\";s:1:\"4\";s:9:\"modelname\";s:27:\"创业计划和预算管理\";s:6:\"teamid\";s:1:\"4\";s:8:\"teamname\";s:15:\"教师端账套\";s:4:\"date\";s:19:\"2018-08-10 09:26:10\";s:3:\"uid\";s:2:\"58\";s:4:\"ztid\";s:1:\"4\";s:7:\"comment\";s:348:\"每个商业模式都需要核心资源,这些资源使得企业组织能够创造和提供价值主张、接触市场、与\r\n客户细分群体建立关系并赚取收入。不同的商业模式所需要的核心资源也有所不同。微芯片制造商需要资本集约型\r\n的生产设置,而芯片设计商则需要更加关注人力资源。\";}', 'jiaoshi于2018-08-10 09:26:10新建打分单据', '2018-08-10 09:26:10', '19', '36');
INSERT INTO `toa_oalog` VALUES ('1418', '58', 'a:9:{s:9:\"dbilldate\";s:10:\"2018-08-10\";s:7:\"modelid\";s:1:\"5\";s:9:\"modelname\";s:18:\"营销关键时刻\";s:6:\"teamid\";s:1:\"4\";s:8:\"teamname\";s:15:\"教师端账套\";s:4:\"date\";s:19:\"2018-08-10 09:26:39\";s:3:\"uid\";s:2:\"58\";s:4:\"ztid\";s:1:\"4\";s:7:\"comment\";s:178:\"核心资源可以是实体资产、金融资产、知识资产或人力资源。核心资源既可以是自由的,也可以是公司租借的或从重要伙伴那里获得的。\";}', 'jiaoshi于2018-08-10 09:26:39新建打分单据', '2018-08-10 09:26:39', '20', '36');
INSERT INTO `toa_oalog` VALUES ('1419', '58', 'a:9:{s:9:\"dbilldate\";s:10:\"2018-08-10\";s:7:\"modelid\";s:1:\"6\";s:9:\"modelname\";s:27:\"财务管理和资本运作\";s:6:\"teamid\";s:1:\"4\";s:8:\"teamname\";s:15:\"教师端账套\";s:4:\"date\";s:19:\"2018-08-10 09:27:00\";s:3:\"uid\";s:2:\"58\";s:4:\"ztid\";s:1:\"4\";s:7:\"comment\";s:312:\"价值主张是客户转向一个公司而非另一个公司的原因,它解决了客户困扰或者满足了客户需求。每个价值主张都包含可选系列产品或服务,以迎合特定客户细分群体的需求。在这个意义上,价值主张是公司提供给客户的受益集合或受益系列。\";}', 'jiaoshi于2018-08-10 09:27:00新建打分单据', '2018-08-10 09:27:00', '21', '36');
INSERT INTO `toa_oalog` VALUES ('1420', '58', 'a:9:{s:9:\"dbilldate\";s:10:\"2018-08-10\";s:7:\"modelid\";s:1:\"7\";s:9:\"modelname\";s:9:\"微分销\";s:6:\"teamid\";s:1:\"4\";s:8:\"teamname\";s:15:\"教师端账套\";s:4:\"date\";s:19:\"2018-08-10 09:27:18\";s:3:\"uid\";s:2:\"58\";s:4:\"ztid\";s:1:\"4\";s:7:\"comment\";s:174:\"企业应该弄清楚希望和每个客户细分群体建立的关系类型。客户关系范围可以从个人到自动化。客户关系可以被以下几个动机所驱动\";}', 'jiaoshi于2018-08-10 09:27:18新建打分单据', '2018-08-10 09:27:18', '22', '36');
