INSERT INTO `toa_syms` VALUES ('①客户细分', '小孩、老人、孕妇、三高人群、全职妈妈、还有一部分高端人士对于生活有更加高品质的生活的人。和其他的企业的客户群体相类似的消费对象消费层次相同的企业合作。');
INSERT INTO `toa_syms` VALUES ('②价值主张', '“打造中原健康食品，引领国人健康理念”是我们企业唯一信奉的价值主张。坚守“用良心诠释产品，用生命捍卫品牌”的经营理念。纯生态，天然弱碱、远离污染、低脂肪、无腥味、无添加、无激素。让鸡如人一般的生活甚至比人活得更好！回归慢生活，慢节奏。');
INSERT INTO `toa_syms` VALUES ('③渠道通路', '线下推广商超、餐厅、酒店、农家乐、联盟企业，利用爱牧智慧宝宝与消费者建立良好的关系产生购买。举办农业智慧终端发布会，当意见的领袖，更好的介绍自身产品。');
INSERT INTO `toa_syms` VALUES ('④客户关系', '互相依存，互利共生。');
INSERT INTO `toa_syms` VALUES ('⑤收入来源', '1.产品的销售额。2.生态农庄的营业额。3.鸡蛋加工副产品以及相关生态产品的销售额。');
INSERT INTO `toa_syms` VALUES ('⑥核心资源', '名贵鸡种，饲养环境相当好。远离城区环境，不受外界干扰、噪音污染。天然林地，山林地散养，在夕阳下自由自在奔跑的鸡。鸡的排泄物来源于自然。又回归于自然。专业成熟的运营团队，优秀的销售人才。专业的营销团队。专业的智能化管理。');
INSERT INTO `toa_syms` VALUES ('⑦关键业务', '专业的卖鸡蛋的企业。生态农庄：亲子游戏，休闲度假，餐饮聚会。和互补企业的合作。例如蛋糕坊。');
INSERT INTO `toa_syms` VALUES ('⑧重要合作', '1.快递2.包装企业合作设计出最完美的包装保护好鸡蛋。3.广告公司合作，全套的VI设计。4.热点热事的活动的合作。例如：奥运会，综艺节目。');
INSERT INTO `toa_syms` VALUES ('⑨成本结构', '1.原料成本：分为鸡种成本，养殖地成本，饲料成本；2.人工成本：制作成本，包装成本，劳动力成本;3.品牌宣传成本：发布会接待成本。');
