INSERT INTO `toa_symsjdhb` VALUES ('2', '价值主张', '1', '价值主张', '#CFCFCF', '9');
INSERT INTO `toa_symsjdhb` VALUES ('2', '关键业务', '1', '多种选择，快速方便，过程简单，优惠手段\n展开过程。用户精确定位，智能匹配相关信息，并作推荐；\n2、操作方便快捷，10秒内3步完成出行信息匹配；\n3、用户实名认证，确保出行信息真实可信；\n4、出行选择的多样性；\n5、车主用油补助，增强软件的互动性和黏粘性；\n6、会员预存优惠，享受商家优惠折扣；\n7、商家互动使车主养护费用降低；\n8、会员福利中心的线上线下互动优惠活动\n大量空闲私家的填充，解决用户打车被动等待的时间\n填补了出租车数量不足的客观现实\n出行线路机动灵活，并且可以促成长期拼车关系', '#DEB887', '15');
INSERT INTO `toa_symsjdhb` VALUES ('2', '关键业务', '1', '1、自主可控技术的研发；与解放军信息工程大学等院校科研单位采用联合筹建河南省重点试验室；\n2、政府采购类大项目营销的开拓；利用许昌市政府参股的优势，以许昌为根据地积极开拓电子政务等市场；', '#DEB887', '16');
INSERT INTO `toa_symsjdhb` VALUES ('2', '关键业务', '2', '关键2', '#F4A460', '5');
INSERT INTO `toa_symsjdhb` VALUES ('3', '核心资源', '1', '核心资源1，核心资源手机端2', '#FFD700', '5');
INSERT INTO `toa_symsjdhb` VALUES ('3', '核心资源', '1', '手机端核心业务测试', '#F4A460', '6');
INSERT INTO `toa_symsjdhb` VALUES ('3', '渠道通路', '1', '渠道通路', '#CFCFCF', '9');
INSERT INTO `toa_symsjdhb` VALUES ('3', '核心资源', '1', '基于智能交通和大数据的趋势，调查数据显示77.2%的受访者支持对移动平台的主导。随着移动出行市场的培养渐进成熟，用户出行多样性顺风车细分领域主要的组成部分。移动出行应用可以与更多的行业实现生态环境的合作对接达到多赢。移动用户2015年数据2.94亿，滴滴63.8亿，Uber12.6亿，政府21.3亿，其他2.4亿。\n现在的拼车正处于快速成长的“风口期”，它被诸多互联网企业认为是下一个平台级的“入口”应用。无论从成本损失还是从出行便利性来考虑，拼车都将是一个高频应用。拼车场景分为远郊区县，城区内，旅游，长途，城际以及其他的细分市场。\n在2015两会期间，交通运输部长杨传堂也公开表示，应当鼓励拼车出行。', '#FFD700', '15');
INSERT INTO `toa_symsjdhb` VALUES ('3', '核心资源', '1', '1、解放军信息工程大学核心技术支持；\n2、许昌市政府参股的政府支持；', '#FFD700', '16');
INSERT INTO `toa_symsjdhb` VALUES ('4', '价值主张', '1', '价值主张测试，价值主张手机端测试2', '#CFCFCF', '5');
INSERT INTO `toa_symsjdhb` VALUES ('4', '价值主张', '1', '手机端价值主张测试', '#DEB887', '6');
INSERT INTO `toa_symsjdhb` VALUES ('4', '客户关系', '1', '客户关系', '#DEB887', '9');
INSERT INTO `toa_symsjdhb` VALUES ('4', '价值主张', '1', '安全稳定，高效，快捷\n长途异地拼车市场留给顺风车的上升空间极乐观。在火车票难求，黑车横行的时代里，顺风车的出现，将对出行有所改观。它的便利便民性，公益性便是它能够快速占据市场的重要保证。', '#FFD700', '15');
INSERT INTO `toa_symsjdhb` VALUES ('4', '价值主张', '1', '1、通过公司研发的自主可控安全信息产品，保障政府及行政事业单位重要信息安全！\n2、安全无价，自主可控，这是公司价值主张。', '#DEB887', '16');
INSERT INTO `toa_symsjdhb` VALUES ('5', '客户关系', '1', '客户关系内容', '#FFD700', '5');
INSERT INTO `toa_symsjdhb` VALUES ('5', '客户关系', '1', '手机端客户关系测试', '#DEB887', '6');
INSERT INTO `toa_symsjdhb` VALUES ('5', '收入来源', '1', '收益来源', '#DEB887', '9');
INSERT INTO `toa_symsjdhb` VALUES ('5', '客户关系', '1', '顺风车预设好路线，乘客搭乘，通过车辆共享来分摊用车成本，解决乘客一票难求以及花费在排队买票，候车室等待等耗时情况。顺风出行最终目的就是为了出行，打造专一的长途异地出行拼车平台，方便大家。自然，出行之中也带有一定的社交性，让漫漫旅途不显得那么枯燥无聊。\n同时，为了规避风险，顺风车用户精确定位，智能匹配相关信息，并作合理推荐。云端进行数据交互，以保证数据的实时有效性。用户实名认证确保了出行信息真实可信。基于嘀嗒打车这类市区打车软件的不断发展，大众对于长途异地的乘车需求也会逐渐上升，这给予了顺风车很好的机会。\n在拼车的用户不断增加的过程中，起到的便利条件不会局限于出行，同时也会有一定的商机。广告的收入也会成为拼车费用产生的资金沉淀。用户的需求，低价，便利，则是顺风车一直的追求。', '#DEB887', '15');
INSERT INTO `toa_symsjdhb` VALUES ('5', '客户关系', '1', '安全可控的自主产品，给客户安全信息保障！', '#DDA0DD', '16');
