INSERT INTO `toa_tzjg` VALUES ('1', '赛伯乐投资集团', '赛伯乐是一家秉承创新创业精神，通过科技、资本和国际化手段，为区域的新兴产业发展服务的投资集团。\r\n作为中国私募股权基金的领导者之一 ，赛伯乐重点关注具有强大整合潜力和平台价值的新兴产业，通过“投资+创业”的开放平台汇聚支撑新兴产业发展的供给侧要素，通过覆盖全国的“百城众创”打造区域创新创业活力，助力传统产业互联网+转型升级，培育全球领先的新兴产业领跑者，让企业插上互联网与资本的翅膀。\r\n赛伯乐具有国际化的资源与背景，拥有中国本土和美国创新创业并成功登陆资本市场的经验，拥有国内外顶级风险投资的资本源泉，拥有通过并购重组等资本运作手段帮助企业实现业务重整和价值再造的经典案例，拥有全面的跨国资源整合能力、全球化的发展视野和全球领先的技术源泉与储备。\r\n自成立以来，在11年中募集了100多支基金，管理资本量超过1000亿人民币，最高回报率达300倍。', 'images/sbl.png', null);
INSERT INTO `toa_tzjg` VALUES ('2', '红杉资本', '红杉资本始终致力于帮助创业者成就基业常青的伟大公司，为成员企业带来全球资源和历史经验。自1972年在美国硅谷成立以来，红杉资本投资了众多创新企业，包括苹果、思科、甲骨文、谷歌、阿里巴巴、Airbnb、京东等产业潮流领导者。红杉资本中国基金作为「创业者背后的创业者」，专注于科技/传媒、医疗健康、消费品/服务、工业科技四个方向的投资机遇 。自2005年9月创立以来，红杉资本中国基金投资了500余家企业 。', 'images/hongshan.png', null);
INSERT INTO `toa_tzjg` VALUES ('3', '富达投资集团', '富达投资集团成立于1946年，其创始人是爱德华 C. 约翰逊二世，总部设在美国波士顿。公司成立的最初承诺为：每天更加勤奋+更加机敏的工作，帮助小额投资者达到他们的目标。经过半个多世纪的发展，富达集团积累了丰富的投资管理经验，能够为客户提供便捷、专业的服务，已经由纯粹的共同基金公司发展成为一个多元化的金融服务公司，向客户提供包括基金管理、信托以及全球经纪服务在内的全面服务。它是推出\"货币市场共同基金帐户\"的第一家基金管理公司。', 'images/fdtz.png', null);
INSERT INTO `toa_tzjg` VALUES ('4', '贝恩资本', '贝恩资本（英文：Bain Capital）是美国一家私人股权投资公司，于1984年由母公司贝恩策略顾问公司的合伙人米特·罗姆尼等三人成立，总部设于马萨诸塞州波士顿。Bain Capital长期致力于科技业务投资，目前的投资项目包括SunGard Data Systems, NXP, Sensata Technologies, FCI, Sun Telephone, Applied Systems和MEI Conlux。Bain Capital总部在波士顿，在香港，上海，东京，纽约，伦敦和慕尼黑有分公司。Bain Capital是国际性私人股权投资基金，管理资金超过650亿美元，涉及私人股权、风险投资资金、上市股权对冲基金和杠杆债务资产管理。', 'images/bntz.png', null);
INSERT INTO `toa_tzjg` VALUES ('5', '美国橡树资本管理有限公司', '美国橡树资本管理有限公司(Oaktree Capital Management)是一家国际性资产管理公司，创立于1995年，总部位于美国加州洛杉矶。截至2013年9月30日，橡树资本管理的资产规模接近800亿美元，投资策略包括私募股本、房地产、亚洲及新兴市场股票、日本投资机会、电力基础设施、不良债务、高息债券、可换股证券及次级债务。橡树资本目前已在全球12个国家的15个城市建立了办公室。在中国，2005年，香港办公室设立，2007年，北京办事处启用。此前，从2004年开始，橡树资本在中国已经以股权投资的形式投资约8.5亿美元，投资项目包括中国银行、中粮集团海外运输船队、澳门星丽门计划等。', 'images/xstz.png', null);
