INSERT INTO `toa_xminfo` VALUES ('2455', '顺风车', '037120180002', '电商类', '郑州小苗软件科技有限公司', '10', '100', '顺风车专注于长途异地出行的拼车，他更多的体现了以用户为主，信息发布系统自动匹配出行信息，参考价格可以根据实际情况进行自主修定拼车价格，可以自主选择出行路线进行精准查找，派发红包的功能迎合了用户娱乐互动的环节，保险，认证和支付增加了用户的便捷与安全性的保障。顺风车平台以长途异地出行为切入点，以回家，出差，进城，旅行等场景。聚结车主和用户需求的结合进行拼车出行。以各地区的顺风车代理进行承前启后的链接，对接本地区的汽车后市场的服务，以汽车保养为全国行业标准，最终形成一个行业的生态循环平台', '陈家林', '', '', '徐州师范大学', null, null, null, '2006-07-01', '4', '15052981685', '无', null, '无', null, '无', null, '无', null, '无', null, '2018-09-07 15:12:00', '147', '15', null, null, null, null, null, null, null, null, null, null, null);
