-- ----------------------------
-- View structure for sfk
-- ----------------------------
DROP VIEW IF EXISTS `sfk`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`127.0.0.1`  VIEW `sfk` AS select `toa_crm_price`.`id` AS `id`,`toa_crm_price`.`title` AS `title`,`toa_crm_price`.`price` AS `price`,`toa_crm_price`.`rectypeid` AS `rectypeid`,`toa_crm_price`.`rectypename` AS `rectypename`,0 AS `paymentid`,0 AS `paymentname` from `toa_crm_price` 
union all 
select `toa_crm_payment`.`id` AS `id`,`toa_crm_payment`.`title` AS `title`,`toa_crm_payment`.`price` AS `price`,0 AS `rectypeid`,0 AS `rectypename`,`toa_crm_payment`.`paymentid` AS `paymentid`,`toa_crm_payment`.`paymentname` AS `paymentname` from `toa_crm_payment` ;
